Verenigde Staten
Actie / Thriller
113 minuten

goed

met Steve Austin, Rick Hoffman en Vinnie Jones

Jack Conrad (Steve Austin) zit in een dodencel in een corrupte gevangenis ergens in Midden-Amerika. Dan doet er zich plotseling 
een mogelijkheid voor om zijn straf te ontlopen : een rijke televisieproducer heeft hem uitgezocht om deel te nemen aan een 
spannende reality TV-show. De corrupte gevangenisleiding wordt simpel omgekocht. Hij wordt gedropt op een verlaten eiland ergens 
in de oceaan. Daar wacht hem een dodelijk lot : hij moet een strijd op leven en dood aangaan met negen andere ter dood 
veroordeelden. Alleen diegene die overblijft zal zijn vrijheid terug krijgen.
